import React, { useState } from "react";
import DateTimePicker from 'react-datetime-picker';

function Todo(){
    const [dueTime, setDueTime] = useState();
    return (
        <div>
            <DateTimePicker value = {dueTime} onChange = {setDueTime}/>
            <p>{dueTime}</p>
        </div>
    );
}

export default Todo
